        if(self.ctx.datasources[0].type!='function'){


        $scope.count = self.ctx.data.length;

        if(self.ctx.currentUser.authority === 'TENANT_ADMIN'){
            if(self.ctx.datasources[0].type == "CUSTOMER"){
            self.ctx.datasources.forEach(x=>{
                deviceService.getCustomerDevices(x.entityId, self.ctx.pageLink(1000, 0)).subscribe(response=>{
                    attributeService.saveEntityAttributes(x.entity.id, 'SERVER_SCOPE', [{key: "countOfDevices", value: response.data.length}]).subscribe();
                })
            });

            deviceService.getTenantDevices(self.ctx.pageLink(200, 0)).subscribe(devices => {
                devices.data.forEach(x=>{
                    if(x.ownerId){
                        if(x.ownerId.entityType === 'CUSTOMER'){
                            customerService.getCustomer(x.ownerId.id).subscribe(cust=>{
                                attributeService.saveEntityAttributes(x.id, 'SERVER_SCOPE', [{key: "customerName", value: cust.name}]).subscribe();
                            })
                        } else {
                            attributeService.saveEntityAttributes(x.id, 'SERVER_SCOPE', [{key: "customerName", value: 'Tenant'}]).subscribe();
                        }
                    }
                })    
            })
        }
        }

        $scope.widgetText = settings.widgetText;
        $scope.titleSize = settings.title;
        $scope.valueSize = settings.value;        

        self.ctx.detectChanges();
    }
    }
}

self.typeParameters = function(){
    return {
        datasourcesOptional: true
    }
}

