self.onInit = function() {
    var $injector = self.ctx.$scope.$injector;
    $scope = self.ctx.$scope;
    attributeService = $scope.$injector.get(self.ctx.servicesMap.get('attributeService'));
    $scope.all = false;
    $scope.online = false;
    $scope.offline = false;

    attributeService.getEntityAttributes({id: self.ctx.currentUser.userId, entityType: 'USER'}, 'SERVER_SCOPE', ['mapDeviceFilter']).subscribe(response => {
        if(response){
            if(response[0].value === "All"){
                $scope.all = true;
            } else if(response[0].value === "Offline"){
                $scope.offline = true;
            } else if(response[0].value === "Online"){
                $scope.online = true;
            }
            self.ctx.detectChanges();
        }
    })

    $scope.onAll = function(event) {
        if(!$scope.all){
            if(event){
                saveAttrubute('default', 'All');
            }
        }
    }

    $scope.onOffline = function(event) {
        if(!$scope.offline){
            if(event){
                saveAttrubute('offlineDevices', 'Offline');
            }
        }
    }

    $scope.onOnline = function(event) {
        if(!$scope.online){
            if(event){
                saveAttrubute('onlineDevices', 'Online');
            }
        }
    }

    function saveAttrubute(state, value){
        attributeService.saveEntityAttributes({id: self.ctx.currentUser.userId, entityType: 'USER'}, 'SERVER_SCOPE', [{key: 'mapDeviceFilter', value: value }]).subscribe(()=>{
                    openDashboardState(state);
                });
    }
}

self.onDataUpdated = function() {
    if(self.ctx.data[0].data[0]){
        if(self.ctx.data[0].data[0][1] === "All"){
            $scope.all = true;
            openDashboardState('default');
        } else if(self.ctx.data[0].data[0][1] === "Offline"){
            $scope.offline = true;
            openDashboardState('offlineDevices');
        } else if(self.ctx.data[0].data[0][1] === "Online"){
            $scope.online = true;
            openDashboardState('onlineDevices');
        }
        self.ctx.detectChanges();
    }
}

function openDashboardState(stateId){
    var params = {}
    self.ctx.stateController.updateState(stateId, params, false);
}

self.onResize = function() {
}

self.onDestroy = function() {
}

