descriptor.controllerScript:
let utils;
let settings, widgetText, color;
let init = true;

let systemProductionAggHour;
let selfConsumptionAggHour;
let exportAggHour;

let myChart;

let option = {
  grid: {
    show: false,
    left: '5%',
    right: '5%',
    top: '',
    bottom: '',
    containLabel: false
  },
  xAxis: {
    type: 'value',
    splitLine: {show: false},
    onZero: false,
    axisLine: {
      show: false
    },
    axisTick: {
      show: false
    },
    axisLabel: {
      show: false
    },
    axisPointer: {
      show: false
    },
    max: 100
  },
  yAxis: {
    type: 'category',
    onZero: false,
    data: [''],
    axisLine: {
      show: false
    },
    axisLabel: {
      show: false
    }
  },
  series: [
    {
      name: 'Self-consumption',
      color: '#007770',
      type: 'bar',
      stack: 'total',
      label: {
        show: true,
        formatter: "{c}%",
        fontWeight: "bold",
        fontSize: '15'
      },
      itemStyle: {
        normal: {
            barBorderColor: '#007770',
            barBorderRadius: [10, 0,0,10]
        }
      },
      data: [80]
    },
    {
      name: 'Export',
      color: '#2e2f3c',
      type: 'bar',
      stack: 'total',
      itemStyle: {
        normal: {
            barBorderColor: '#007770',
            barBorderRadius: [0, 10, 10, 0]
        }
      },
      data: [20]
    }
  ]
};

self.onInit = function() {
    let divId = 'barColumn_' + self.ctx.widget.id;
    let div = document.getElementById('productionChartDiv');
    div.style = 'height: 50%; width: 100%; margin:0';
    div.setAttribute('id', divId);

    myChart = echarts.init(div);
    self.ctx.$scope.widgetText = widgetText;

    units = self.ctx.widget.config.units;
    decimals = self.ctx.widget.config.decimals;

    utils = self.ctx.$scope.$injector.get(self.ctx.servicesMap.get('utils'));
    settings = utils.deepClone(self.ctx.settings) || {};
    option && myChart.setOption(option);
    self.ctx.updateWidgetParams(); 
}

self.onDataUpdated = function() {
    if(self.ctx.datasources[0].type!='function'){
        self.ctx.$scope.widgetText = settings.widgetText;
        self.ctx.$scope.color = settings.color;

        if(self.ctx.data[0].data[0]){
            option.series[0].data[0] = self.ctx.data[0].data[0][1];
            if(settings.color){
                option.series[0].color = self.ctx.$scope.color;
                option.series[0].itemStyle.normal.barBorderColor = self.ctx.$scope.color;
                option.series[1].itemStyle.normal.barBorderColor = self.ctx.$scope.color;
            }
            option.series[1].data[0] = 100-self.ctx.data[0].data[0][1];
        }

        myChart.setOption(option);
        self.ctx.detectChanges();
    }
}

self.onLatestDataUpdated = function() {
}

self.onResize = function() {
    myChart.resize();
    self.ctx.detectChanges();
}

self.onEditModeChanged = function() {
}

self.onDestroy = function() {
}

self.typeParameters = function() {
    return {
        hasAdditionalLatestDataKeys: true
    };
}

